import React from 'react';

const Card = (props) => {

  return (
    <div className="card">
      <h1>{props.title}</h1>
      <ul>
        {props.data.map((d) => (
          <li>{d}</li>
        ))}
      </ul>
    </div>
  );

}

export default Card;
